import { SUCCESS } from '../actions/types';

const initialState = '';

const successReducer = (state = initialState, action) => {
  switch (action.type) {
    case SUCCESS:
      console.log('some success happened');
      return {
        state: action.payload,
      };
  }
};

export default successReducer;
